import React, { useState } from "react";
import './index.css';


const state = useState();
console.log(state);

var count=0;
const IncCount = () => {
    console.log("Button Clicked");
    count++;
    console.log(count);
}
    
const App = () => {
return(
    <>
    <h1>{count}</h1>
    <button onClick={IncCount}>Click Me</button>
    </>
)
}

export default App;
